import React from 'react';
import '../App.css';

export function LocationFrame(props) {

    const id = props.id;
    const name = props.name;
    const weather = props.weather;
    const temp = props.temp;

    return (
        <div id={id}>
            <h3>{name}</h3>
            <img src={require(`../resources/WeatherIcons/${weather}.svg`)} alt='Weather icon' className='App-icon'/>
            <p>{temp}</p>

        </div>
    )
}
